import Layout from "../components/Layout"
const Weather = (props) => {
   return (

      <Layout>
         <div className="container">
            {props.date}
         </div>
      </Layout>

   );
}

Weather.getInitialProps = () => {
   const date = new Date.getMo
   return {
      date
   }
}

export default Weather;
